INSERT INTO `edu_competency` VALUES (1,1,'a','Configurar y explotar sistemas informáticos, adaptando la configuración lógica del sistema según las necesidades de uso y los criterios establecidos.\r'),(2,1,'b','Aplicar técnicas y procedimientos relacionados con la seguridad en sistemas, servicios y aplicaciones, cumpliendo el plan de seguridad.\r'),(3,1,'c','Gestionar bases de datos, interpretando su diseño lógico y verificando integridad, consistencia, seguridad y accesibilidad de los datos.\r'),(4,1,'d','Gestionar entornos de desarrollo adaptando su configuración en cada caso para permitir el desarrollo y despliegue de aplicaciones.\r'),(5,1,'e','Desarrollar aplicaciones multiplataforma con acceso a bases de datos utilizando lenguajes, librerías y herramientas adecuados a las especificaciones.\r'),(6,1,'f','Desarrollar aplicaciones implementando un sistema completo de formularios e informes que permitan gestionar de forma integral la información almacenada.\r'),(7,1,'g','Integrar contenidos gráficos y componentes multimedia en aplicaciones multiplataforma, empleando herramientas específicas y cumpliendo los requerimientos establecidos.\r'),(8,1,'h','Desarrollar interfaces gráficos de usuario interactivos y con la usabilidad adecuada, empleando componentes visuales estándar o implementando componentes visuales específicos.\r'),(9,1,'i','Participar en el desarrollo de juegos y aplicaciones en el ámbito del entretenimiento y la educación empleando técnicas, motores y entornos de desarrollo específicos.\r'),(10,1,'j','Desarrollar aplicaciones para teléfonos, PDA y otros dispositivos móviles empleando técnicas y entornos de desarrollo específicos.\r'),(11,1,'k','Crear ayudas generales y sensibles al contexto, empleando herramientas específicas e integrándolas en sus correspondientes aplicaciones.\r'),(12,1,'l','Crear tutoriales, manuales de usuario, de instalación, de configuración y de administración, empleando herramientas específicas.\r'),(13,1,'m','Empaquetar aplicaciones para su distribución preparando paquetes auto instalables con asistentes incorporados.\r'),(14,1,'n','Desarrollar aplicaciones multiproceso y multihilo empleando librerías y técnicas de programación específicas.\r'),(15,1,'ñ','Desarrollar aplicaciones capaces de ofrecer servicios en red empleando mecanismos de comunicación.\r'),(16,1,'o','Participar en la implantación de sistemas ERP-CRM evaluando la utilidad de cada uno de sus módulos.\r'),(17,1,'p','Gestionar la información almacenada en sistemas ERP-CRM garantizando su integridad.\r'),(18,1,'q','Desarrollar componentes personalizados para un sistema ERP-CRM atendiendo a los requerimientos.\r'),(19,1,'r','Realizar planes de pruebas verificando el funcionamiento de los componentes software desarrollados, según las especificaciones.\r'),(20,1,'s','Desplegar y distribuir aplicaciones en distintos ámbitos de implantación verificando su comportamiento y realizando las modificaciones necesarias.\r'),(21,1,'t','Establecer vías eficaces de relación profesional y comunicación con sus superiores, compañeros y subordinados, respetando la autonomía y competencias de las distintas personas.');
