INSERT INTO `edu_criterion` VALUES (1,1,'a','Se ha identificado la estructura organizativa de la empresa y las funciones de cada área de la misma.\r',NULL),(2,1,'b','Se han reconocido las relaciones organizativas y funcionales del departamento de control de calidad con los demás departamentos de la empresa.\r',NULL),(3,1,'c','Se han identificado los elementos que constituyen la red logística de la empresa: proveedores, clientes, sistemas de producción, almacenaje y otros.\r',NULL),(4,1,'d','Se han identificado los procedimientos de trabajo en el desarrollo del proceso productivo.\r',NULL),(5,1,'e','Se han relacionado las competencias profesionales, personales y sociales de los recursos humanos con el desarrollo de la actividad productiva.\r',NULL),(6,1,'f','Se han relacionado características del mercado, tipos de clientes y proveedores y su posible influencia en el desarrollo de la actividad empresarial.\r',NULL),(7,1,'g','Se han identificado los canales de comercialización más frecuentes en esta actividad.\r',NULL),(8,1,'h','Se han valorado las ventajas e inconvenientes de la estructura de la empresa frente a otro tipo de organizaciones empresariales.',NULL),(9,2,'a','Se han reconocido y justificado:\r\n- La disposición personal y temporal que necesita el puesto de trabajo.\r\n- Las actitudes personales (puntualidad, empatía, entre otras) y profesionales (orden, seguridad e higiene en el puesto de trabajo, responsabilidad, entre otras).\r\n- Los requerimientos actitudinales ante la prevención de riesgos en la actividad profesional y las medidas de protección personal.\r\n- Los requerimientos actitudinales referidos a la calidad en la actividad profesional.\r\n- La dinámica relacional con respecto al equipo de trabajo y a la estructura jerárquica establecida en la empresa.\r\n- Las actitudes relacionadas con la documentación de las actividades realizadas en el ámbito laboral.\r\n- Las necesidades formativas específicas para la inserción y reinserción laboral.',NULL),(10,2,'b','Se han identificado las normas de prevención de riesgos laborales que hay que aplicar en la actividad profesional y los aspectos fundamentales de la Ley de Prevención de Riesgos Laborales.\r',NULL),(11,2,'c','Se han utilizado equipos de protección individual adecuados a los riesgos de la actividad profesional y a las normas de la empresa.\r',NULL),(12,2,'d','Se ha mantenido una actitud clara de respeto al medio ambiente en las actividades desarrolladas y aplicado las normas internas y externas al respecto.\r',NULL),(13,2,'e','Se ha mantenido organizado, limpio y libre de obstáculos el puesto de trabajo o área correspondiente al desarrollo de la actividad.\r',NULL),(14,2,'f','Se han interpretado y cumplido las instrucciones recibidas, responsabilizándose del trabajo asignado.\r',NULL),(15,2,'g','Se ha establecido una comunicación y relación eficaz con la persona responsable en cada situación y miembros de su equipo, manteniendo un trato fluido y correcto.\r',NULL),(16,2,'h','Se ha valorado la importancia de su actividad y la adaptación a los cambios de tareas asignadas en el desarrollo de los procesos productivos de la empresa, integrándose en las nuevas funciones.\r',NULL),(17,2,'i','Se ha comprometido responsablemente en la aplicación de las normas y procedimientos en el desarrollo de cualquier actividad o tarea.',NULL),(18,3,'a','Se ha interpretado la normativa o bibliografía adecuada al tipo de tarea a desarrollar.\r',NULL),(19,3,'b','Se ha reconocido en que fases del proceso o proyecto se encuadran las tareas a realizar.\r',NULL),(20,3,'c','Se ha planificado el trabajo para cada tarea, secuenciando y priorizando sus fases.\r',NULL),(21,3,'d','Se han identificado los equipos y servicios auxiliares necesarios para el desarrollo de la tarea encomendada.\r',NULL),(22,3,'e','Se ha organizado el aprovisionamiento y almacenaje de los recursos necesarios.\r',NULL),(23,3,'f','Se ha valorado el orden y el método en la realización de las tareas.\r',NULL),(24,3,