INSERT INTO `wpt_activity` VALUES (1,1,'M_01','Identifica la estructura y organización de la empresa relacionándola con el desarrollo y comercialización de los productos que obtiene.'),(2,1,'M_02','Ejerce la actividad profesional aplicando hábitos éticos y laborales acordes con las características del puesto de trabajo y los procedimientos establecidos en la empresa.'),(3,1,'M_03','Organiza los trabajos a desarrollar, identificando las tareas asignadas a partir de la planificación de proyectos e interpretando documentación específica.'),(4,1,'M_04','Gestiona y utiliza sistemas informáticos y entornos de desarrollo, evaluando sus requerimientos y características en función del propósito de uso.'),(5,1,'M_05','Participa en el desarrollo de aplicaciones con acceso a datos planificando la estructura de la base de datos y evaluando el alcance y la repercusión de las transacciones.'),(6,1,'M_06','Interviene en el desarrollo de juegos, aplicaciones multimedia y aplicaciones para dispositivos móviles empleando las herramientas y lenguajes específicos y cumpliendo el guion y las especificaciones establecidas.'),(7,1,'M_07','Colabora en el desarrollo y prueba de aplicaciones multiplataforma, desde la interfaz hasta la programación de procesos y servicios, incluyendo su empaquetado y distribución, así como todas las ayudas y documentación asociadas.'),(8,1,'M_08','Participa en el proceso de implantación y adaptación de sistemas de gestión de recursos y de planificación empresarial (ERP-CRM) analizando sus características y valorando los cambios realizados.');
/*!40000 ALTER TABLE `wpt_activity` ENABLE KEYS */;
